import { room1 } from "./../../src/image/index"

export default function Board() {

    const grid = new Array(100).fill([])
    grid.forEach(row => {
        for (let i = 0; i < 100; i++) {
            row.push('')
        }
    })



    console.log(grid)

    return (
        <div style={{overflow: 'hidden', backgroundColor: 'black', width: '100%', height: '90%', position: "absolute"}}>
            <div>
                <Room room={room1} />
            </div>
        </div>
    )


}
